import { Col, Row, Button, Form, FormGroup, Label, Input, FormText, ListGroup, ListGroupItem } from 'reactstrap';

export default class Example extends React.Component {
 constructor(props) {
    super(props);
    this.state = {isToggleOn: true};

    this.state = { song: [] };

    // This binding is necessary to make `this` work in the callback
    this.handleClick = this.handleClick.bind(this);
  }


  componentDidMount(){


    fetch('https://se3309-final-project-amali28.c9users.io:8081/song')
    .then(res=> res.json())
    .then(json => {
   this.setState({

        song: json
      })
    });
  }





   handleClick(name){
     //console.error( '$(e.target.value)' )

  }
  render() {
      var{ song} = this.state;
      document.getElementById("searchField").innerHTML= song;

    return (

      <Form>
        <Row form>
          <Col md={6}>
            <FormGroup>
              <Label for="Playlist">Search</Label>
              <Input type="text" name="search" id="searchField" placeholder="Search for a song, album, or playlist" onChange={this.handleChange()}/>
            </FormGroup>
          </Col>
        </Row>
        <Button onClick= {this.handleClick} id="search" >Search</Button>
      </Form>

    );
  }




}
